import Items from './Items';
import './App.css';
import Item from './Item';


function createItem(Item){
  return (<Item key={Item.key} title={Item.item} name={Item.name} price={Item.price}/>
 );}



function App() {

  return (
    <div className="App">
{Item.map(createItem)}
    </div>
  );
}

export default App;
